import React, { useState, useEffect } from "react";

const ConsolidationTable2 = ({ acciones, apiKey }) => {
  const [preciosActuales, setPreciosActuales] = useState({});
  const [loading, setLoading] = useState(true);

  // Función para obtener precios actuales desde la API
  const fetchCurrentPrices = async () => {
    try {
      const precios = {};
      for (const accion of acciones) {
        const response = await fetch(
          `https://finnhub.io/api/v1/quote?symbol=${accion.nombre}&token=${apiKey}`
        );
        const data = await response.json();
        precios[accion.nombre] = data.c; // `c` es el precio actual en Finnhub
      }
      setPreciosActuales(precios);
      setLoading(false);
    } catch (error) {
      console.error("Error al obtener los precios actuales:", error);
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchCurrentPrices();
  }, [acciones]);

  // Agrupar acciones por nombre y calcular totales
  const groupByAccion = () => {
    const grouped = {};

    acciones.forEach((accion) => {
      if (!grouped[accion.nombre]) {
        grouped[accion.nombre] = {
          nombre: accion.nombre,
          totalCantidad: 0,
          totalUSD: 0,
        };
      }
      grouped[accion.nombre].totalCantidad += accion.numeroAcciones || 0;
      grouped[accion.nombre].totalUSD += (accion.valor || 0) * (accion.numeroAcciones || 0);
    });

    return Object.values(grouped);
  };

  const accionesAgrupadas = groupByAccion();

  // Calcular métricas adicionales usando las columnas de la tabla
  const calculateMetrics = (accion) => {
    const costPrice = accion.totalCantidad > 0 ? accion.totalUSD / accion.totalCantidad : 0;
    const currentPrice = preciosActuales[accion.nombre] || 0;
    const gainLossUSD =
      accion.totalCantidad > 0 ? (currentPrice - costPrice) * accion.totalCantidad : 0;
    const gainLossPercentage =
      costPrice > 0 ? ((currentPrice - costPrice) / costPrice) * 100 : 0;

    return {
      costPrice: costPrice.toFixed(2),
      currentPrice: currentPrice.toFixed(2),
      gainLossUSD: gainLossUSD.toFixed(2),
      gainLossPercentage: gainLossPercentage.toFixed(2),
    };
  };

  if (loading) {
    return <div>Cargando datos...</div>;
  }

  return (
    <div className="mt-8 p-6 bg-white rounded-lg shadow-lg">
      <h2 className="text-xl font-bold mb-4">Consolidación de Acciones</h2>
      <div className="overflow-x-auto">
        <table className="w-full border-collapse">
          <thead>
            <tr className="bg-gray-50">
              <th className="border p-2 text-left">ACCIÓN</th>
              <th className="border p-2 text-right">CANTIDAD TOTAL</th>
              <th className="border p-2 text-right">VALOR USD</th>
              <th className="border p-2 text-right">PRECIO DE COSTO</th>
              <th className="border p-2 text-right">PRECIO ACTUAL</th>
              <th className="border p-2 text-right">%GANANCIA/PÉRDIDA</th>
              <th className="border p-2 text-right">$GANANCIA/PÉRDIDA</th>
            </tr>
          </thead>
          <tbody>
            {accionesAgrupadas.map((accion, index) => {
              const { costPrice, currentPrice, gainLossUSD, gainLossPercentage } =
                calculateMetrics(accion);

              return (
                <tr key={index} className="hover:bg-gray-50">
                  <td className="border p-2">{accion.nombre}</td>
                  <td className="border p-2 text-right">{accion.totalCantidad}</td>
                  <td className="border p-2 text-right">{accion.totalUSD.toFixed(2)}</td>
                  <td className="border p-2 text-right">{costPrice}</td>
                  <td className="border p-2 text-right">{currentPrice}</td>
                  <td className="border p-2 text-right">{gainLossPercentage}%</td>
                  <td className="border p-2 text-right">{gainLossUSD}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ConsolidationTable2;
